import React from 'react';

const TableauJoueurs = () => {
    return (
        <article>
            <h1> Liste des joueurs </h1>
            <button> Ajouter un joueur </button>
            <table>
                <tbody>
                    <tr>
                        <th> Photo </th>
                        <th> Nom </th>
                        <th> Prenom </th>
                        <th> Numéro de licence </th>
                        <th> Age </th>
                        <th> Taille en cm </th>
                        <th> Poids en kg </th>
                        <th> Poste préféré </th>
                        <th> Statut </th>
                    </tr>
                </tbody>
            </table>
        </article>
    );
};

export default TableauJoueurs;
